import './App.css';
import React, { useState } from "react";
import General from './Components/General';
import Skills from './Components/Skills';
import Resume from './Components/Resume';
import NewExperience from './Components/NewExperience';
import Education from './Components/Education';

function App() {
  const [personalInfo, setPersonalInfo] = useState(["", "", "", "", ""]);
  const [previousExperience, setPreviousExperience] = useState(["", "", "", ""]);
  const [skills, setSkills] = useState([]);
  const [experiences, setExperiences] = useState([]);
  const [education, setEducation] = useState(["", "", "", ""]);

  function addExperience() {
    setExperiences(experiences.concat(
    <div className="add-experience">
      {previousExperience[2]} to {previousExperience[3]}: {previousExperience[0]} at {previousExperience[1]}
    </div>))
  }

  return (
    <div className="project">
      <div className="navbar">
        <h1> Software Engineer CV </h1>
      </div>
      <div className="submission">
        <General setPersonalInfo={setPersonalInfo}/>
        <Education setEducation={setEducation}/>
        <Skills/>
        <NewExperience setPreviousExperience={setPreviousExperience}/>
        <button onClick={addExperience}> Add </button>
      </div>
      <Resume personalInfo={personalInfo} previousExperience={previousExperience} education={education} experiences={experiences}/>
    </div>
  )
}

export default App;
